import React from "react";
import "./App.css";

function App() {
  return (
    <div className="App">
      <h1>MowGrass-IT</h1>
      <a href="/"></a>
      <button type="button" class="btn btn-primary">
        PRécupérer le sujet
      </button>
    </div>
  );
}

export default App;
